8716219f1d0d9eb539c5d75834271437bb1f0cb3:
query GetAnimeCharacter($id: Int!) {
  Character(id: $id) {
    name {
      first
      last
    }
    image {
      large
    }
    age
    description
  }
}

4dcdc18961b94f41ba059827f6703996b459be50:
query GetCountry($code: ID!) {
  country(code: $code) {
    name
    native
    capital
    emoji
    currency
    languages {
      code
      name
    }
  }
}

3ff8a0a8d49d3e40b2a1d64163a54c717efb4cb9:
query GetPetById($petId: BigInt!) {
  getPetById(petId: $petId) {
    name
    category {
      id
      name
    }
  }
}
